pragma solidity ^0.8.7;

import "hardhat/console.sol";

/* Errors */

error Payments_AmntLessMin();

contract Payments {

    struct TipInfo {
        address u_address;
        uint256 amount;
    }

    mapping(address => TipInfo[]) public s_profiles;

    function tip(address payable tip_address) public payable {

        s_profiles[tip_address].push(TipInfo(msg.sender, msg.value));
        tip_address.transfer(msg.value);

    }

}
